import React from "react";
import Club from "./Club";
const listClubs = (props) => {
  console.log(props);
  const indexClubs = props.data.map((item, i) => {
    return (
      <li key={i}>
        <h2>{props.item.name}</h2>
        <p>members</p>
        {item.members}
      </li>
    );
  });

  return (
    <ul>
      <Club title={indexClubs} />
    </ul>
  );
};

export default listClubs;
